import java.io.*;import java.util.*;public class MyClass {    public static void main(String args[]) {        Scanner sc=new Scanner(System.in);         int n=sc.nextInt();         long x=sc.nextLong();         int y=sc.nextInt();         long a=y-(n-1);         long b=x-(n-1);         if(a*a>=b&&a>0)           {              for(int i=1;i<n;i++)              System.out.println("1");              System.out.println(a);           }         else         System.out.println("-1");             }}
